import React from "react";

const Day22 = (props) => {
  return (
    <div className='day'>
      <h2>May 22</h2>
      <p>Today will be spent in Barcelona as people arrive from the airport. We will explore some of the rich cultural heritage of the city</p>
        <ul>
            <li>Arrive in Barcelona</li>
            <li>Take cab to hotel and check in</li>
            <li>Drop luggage and head out</li>
            <li>Enjoy exploring the city and its lively sights!</li>
        </ul>
    </div>
  );
};

export default Day22;
